import React, {useState, useEffect} from 'react';
import ReactDOM from 'react-dom';
import { Link, useHistory } from 'react-router-dom';
import 'antd/dist/antd.css';
import moment from 'moment';
import 'moment/locale/ko';
import axios from 'axios';
import { List, Avatar, Button, Skeleton, Rate } from 'antd';
import {ReviewButton, PostHeader} from './ShowPost';
import { ArrowLeftOutlined } from '@ant-design/icons';
import profile from './images/profile.png'
import styled from 'styled-components';


const StyledBtn=styled(Button)`
&:hover, &:focus {
  color:#A352CC;
  background-color:#ffffff;
  border:1px solid #A352CC;
}
`;
const ReviewList=()=> {

    const count = 3;
    const fakeDataUrl = `https://randomuser.me/api/?results=${count}&inc=name,gender,email,nat,picture&noinfo`;
    const [initLoading,setInitLoading]= useState(true);
    const [loading,setLoading]=useState(false);
    const [data,setData]=useState([]);
    const [list,setList]=useState([]);
    const [starVal,setStarVal]=useState(3);
    const [temp,setTemp]=useState('안녕하세요  빔프로젝터 빌려가실 분을 찾습니다 안녕하세요 빔프로젝터 빌려가실 분을 찾습니다 안녕하세요 빔프로젝터 빌려가실 분을 찾습니다안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다 안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다 안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다  안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다 안녕하세요 \n 빔프로젝터 빌려가실 분을 찾습니다 ')

    //  rate: currentValue, //별점 
    //         content:reviewContent, //리뷰글 
    //시작할 때 실행
    useEffect(()=>{
        axios.get(fakeDataUrl)
          .then(res => {
            setInitLoading(false);
            setData(res.data.results);
            setList(res.data.results);
            }).catch((error)=>{
                console.log(error);
            })},[]);
    

    const onLoadMore = () => {
          setLoading(true);
          setList(data.concat(
            [...new Array(count)].map(() => ({ loading: true})),
          ));
        axios.get(fakeDataUrl)
          .then(res => {
            const newData=data.concat(res.data.results);
            setData(newData);
            setList(newData);
            setLoading(false);
          }).catch(error=>{
            console.log(error)
          })
                // Resetting window's offsetTop so:to display react-virtualized demo underfloor.
                // In real scene, you can using public method of react-virtualized:
                // https://stackoverflow.com/questions/46700726/how-to-use-public-method-updateposition-of-react-virtualized
                window.dispatchEvent(new Event('resize'));
          };
      
     
      const loadMore =
       !(initLoading &&loading) ?
          (<div
            style={{
              textAlign: 'center',
              marginTop: 12,
              height: 32,
              lineHeight: '32px',
            }}
          >
            <StyledBtn onClick={onLoadMore}>빌린 후기 더보기</StyledBtn>
          </div>)
          :null;

    return (
        <List
          className="demo-loadmore-list"
          loading={initLoading}
          itemLayout="horizontal"
          loadMore={loadMore}
          dataSource={list}
          renderItem={item => (
                // {postInfo.user.id===curUser.id&& 
            <List.Item
              actions={[<Link to={"list-loadmore-edit"}>수정</Link>, <Link to={"list-loadmore-more"}>삭제</Link>]}
            >
              {/* } */}
              <Skeleton avatar title={false} loading={item.loading} active>
                <List.Item.Meta
                  avatar={<Avatar src={profile} />}
                  title={
                    <div>
                    <div style={{display:'flex', justifyContent:'space-between'}}> 
                  <span style={{fontWeight:'bold'}}>{item.gender}</span>
                  <Rate style={{color:'#EBCAFD', fontSize:'16px', marginRight:'20px'}} disabled defaultValue={starVal} />
                  </div>
                   <span style={{fontWeight:'normal', color:'#7D7D7D', fontSize:'12px'}}>{item.email}</span>
                   </div>
                }
                  description={
                     temp.split("\n").map((line) => { //postInfo.body: 글내용
                      return (
                        <div style={{color:'black', wordBreak:'break-all'}}>
                          {line}
                      </div>
                    );
                    })} 

                />
              </Skeleton>
            </List.Item>
          )}
          style={{marginBottom:'100px'}}
        />
    );
 }

 export default ReviewList;
